import { useState } from 'react';

import Navbar from './Navbar';
import Todoview from './Todoview';


const Mainview = () => {
    const [ viewStatus, setViewStatus ] = useState("ToDo View");
    const [ todoView, setTodoView ] = useState(true);



    return (
        <div className="full-container relative">
            <Navbar viewStatus={viewStatus}/>
            {todoView ? <Todoview /> : null}
        </div>
    );
}

export default Mainview;
